April 29, 2010
There are a lot of rumours about the eccentric fashion designer, Scott Nails. Some call him innovative, genius and others call him a perv. However, when he has a photo shoot for his clothing line, all the models line up for the gig. Madison and Jayden have never worked with the designer before, but find out very soon why they call him Mr. Sleaze.
